window.bookSummaryJSON = "<p>The Eurasia fleet has entered the Darg star system. The unsuspecting players look forward to the adventure of their lifetimes. Zander alone is now facing a harsh and unpredictable \"alternative storyline\". The girl he loved is gone. His nervous system is impregnated with artificial neurons that contain fragments of ancient AIs and their identities. Zander's body is implanted with alien artifacts that allow him to survive in the deadly cyberspace of Phantom Server. But his unique development branch pushes him toward the edge of the precipice where his every step may become his last - where the future itself is vague and uncertain. </p>"; 
